            private void Preencher_Conteudo()                              
            {
                      Arv_Temas.Nodes.Clear();
                      Arv_Bairros.Nodes.Clear();
                      foreach (string[] g in Rio_Grupos())
                      {
                                 string gcod = g[0];
                                 string gtxt = g[1];
                                 Arv_Temas.Nodes.Add(gcod + "   " + gtxt);
                      }
                      for (int a = 0; a < Arv_Temas.Nodes.Count; a++)
                      {
                                 TreeNode Nodo =  Arv_Temas.Nodes[a];
                                 temassel.Add(Nodo);
                                 string grupo  = Nodo.Text.Substring(0, 3);
                                 foreach (string[] g in Rio_GruTema())
                                 {
                                         string gcod = g[0];
                                         string tema = g[1];
                                         string desc = g[2];
                                         if (grupo == gcod)
                                             Arv_Temas.Nodes[a].Nodes.Add(tema + " " + desc);
                                 }
                      }
                      foreach (string[] g in Rio_APs())
                      {
                                 string codAP  = g[0];
                                 string regiao  = g[1];
                                 Arv_Bairros.Nodes.Add(codAP + "   " + regiao);
                      }
                      for (int a = 0; a < Arv_Bairros.Nodes.Count; a++)
                      {
                                 TreeNode Nodo = Arv_Bairros.Nodes[a];
                                 bairrsel.Add(Nodo);
                                 string aplan = Nodo.Text.Substring(0, 3);
                                 foreach (string[] p in Rio_APlanej())
                                 {
                                         string anum = p[0];
                                         string azon = p[1];
                                         if (aplan == anum)
                                             Arv_Bairros.Nodes[a].Nodes.Add(azon);
                                 }
                      }
                      label1.Text = "-";
                      label3.Text = "-";
            }

