            void SelecionarTemas(TreeNodeCollection nodos)                 
            {
                                               temassel = new List<TreeNode>();
                                               foreach (TreeNode nodo in nodos)
                                               {
                                                     TreeNode Nodo = nodo;
                                                     if (nodo.Checked)
                                                     {
                                                         temassel.Add(nodo);
                                                     }
                                                     Nodo.Expand();
                                               } 
            }
            void SelecionarBairr(TreeNodeCollection nodos)                 
            {
                                               bairrsel = new List<TreeNode>();
                                               foreach (TreeNode nodo in nodos)
                                               {
                                                    TreeNode Nodo = nodo;
                                                    if (nodo.Checked)
                                                    {
                                                        bairrsel.Add(nodo);
                                                    }
                                               } 
            }
          
            private void ProcessarTemas_Click  (object sender, EventArgs e)
            {
                                 SelecionarTemas(Arv_Temas.Nodes);
                                 string tema  = "";
                                 string temas = "";
                                 Temario      = new List<string>{};
                                 label3.Text  = temas;

                                 for (int a = 0; a < Arv_Temas.Nodes.Count; a++)
                                 {
                                           TreeNode           NodoPai = Arv_Temas.Nodes[a];
                                           TreeNodeCollection NodosFi = NodoPai.Nodes;
                                           for (int n = 0; n < NodosFi.Count; n++)
                                           {
                                                 TreeNode Nodo = NodosFi[n];
                                                 Arv_Temas.SelectedNode = Nodo;
                                                 tema = Nodo.Text.ToUpper().Substring(0, 3);
                                                 if (Nodo.Checked)
                                                 {
                                                         temas += tema + ":";
                                                         Temario.Add(tema);
                                                 }
                                                 else
                                                 {
                                                         Temario.Remove(tema);
                                                 }
                                           }
                                 }
                                 label3.Text = temas;
             }
            private void ProcessarBarri_Click  (object sender, EventArgs e)
            {
                                 SelecionarBairr(Arv_Bairros.Nodes);
                                 string apla  = "";
                                 string areas = "";
                                 Barrios = new List<string> { };
                                 label1.Text = areas;

                                 for (int a = 0; a < Arv_Bairros.Nodes.Count; a++)
                                 {
                                           TreeNodeCollection Nodos = Arv_Bairros.Nodes[a].Nodes;
                                           for (int n = 0; n < Nodos.Count; n++)
                                           {
                                                 TreeNode Nodo = Nodos[n];
                                                 apla = Nodo.Text;
                                                 if (Nodo.Checked)
                                                 {
                                                         areas += apla + ":";
                                                         Barrios.Add(apla);
                                                 }
                                                 else
                                                 {
                                                         Barrios.Remove(apla);
                                                 }
                                           }
                                 }
                                 label1.Text = areas;
            }
